import { useState } from 'react';
import {Link} from 'react-router-dom';
import TeacherLogout from './TeacherLogout';

function TeacherHeader() {

    const myStyle={
        color: "black",
        margin: "20px",
        fontSize: "20px"
    };

    const [modalOpen, setModalOpen] = useState(false);


    return (
        <>
<nav className="navbar navbar-expand-sm navbar-dark">
  <div className="container-fluid">
    
    <div className="collapse navbar-collapse" id="mynavbar">
      <ul className="navbar-nav me-auto">
        <li className="nav-item">
          <Link to="/teacher-profile"><h6 className="head-words" style={myStyle}>Профиль</h6></Link>
        </li>
        <li className="nav-item">
          <Link to="/teacher-my-courses"><h6 className="head-words" style={myStyle}>Менің курстарым</h6></Link>
        </li>
        <li className="nav-item">
          <Link to="/teacher-add-course"><h6 className="head-words" style={myStyle}>Курс қосу</h6></Link>
        </li>
        <li className="nav-item">
          <Link to="/teacher-my-users"><h6 className="head-words" style={myStyle}>Қолданушыларым</h6></Link>
        </li>
        <li className="nav-item">
          <Link to="/teacher-profile-settings"><h6 className="head-words" style={myStyle}>Баптаулар</h6></Link>
        </li>
        <li className="nav-item">
          <Link to="/teacher-change-password"><h6 className="head-words" style={myStyle}>Құпиясөзді өзгерту</h6></Link>
        </li>
        <li className="nav-item">
         <h6 className="head-words" onClick={() => {setModalOpen(true); }} style={myStyle}>Шығу</h6>
          
        </li>
      </ul>
      
    </div>
  </div>
</nav>
{modalOpen && <TeacherLogout setOpenModal={setModalOpen} />}
        </>
    );
}
export default TeacherHeader;
